import styled from 'styled-components';

const Addnew = () =>{
    return(
        <Btnwrapper>
            <Button type='button'>Add New</Button>
        </Btnwrapper>

    )
}
const Btnwrapper = styled.div`
    display:flex;
    justify-content:end;
    padding:10px;
`
const Button = styled.button`
    padding:10px;
    background-color:red;
    border:none;
    color:white;
    cursor:pointer;
`
export default Addnew
